class Solution:
    def validSubarrays(self, nums):
        n = len(nums)
        i = 0
        res = 0
        #print(n)
        while i < n:
            j = i
            while j < n and nums[j] >= nums[i]:
                res += 1
                j += 1
            i += 1
        return res


